import React from 'react';
import { Button } from '@mantine/core';
import styled from 'styled-components';

const Title = styled.p`
  font-size: 1.5rem;
`;
const Wrapper = styled.div`
  display: flex;
  align-items: center;
  flex-direction: column;
`;

const HomePage = () => {
  return (
    <Wrapper>
      <Title>StackGen</Title>
      <Button>Test!</Button>
    </Wrapper>
  );
};

export default HomePage;
